export const FONT_SIZE_SMALL = '0.8rem';
export const FONT_SIZE_MEDIUM = '1rem';
export const FONT_SIZE_LARGE = '1.2rem';
export const FONT_SIZE_EXTRA_LARGE = '1.5rem';
export const FONT_SIZE = {
  SMALL: "FONT_SIZE_SMALL",
  MEDIUM: FONT_SIZE_MEDIUM,
  LARGE: FONT_SIZE_LARGE,
  EXTRA_LARGE: FONT_SIZE_EXTRA_LARGE,
}

export default {
  BACKGROUND: {
    LIGHT_PINK: '#FDE2E9',
    REGULAR_PINK: '#FA92AD',
    DARK_PINK: '#E0607E', 
    BLACK: '#000000',
    WHITE: '#FFFFFF',
  }
}
